// Solution 1:
const removeDuplicateLetters = (s) => {
    const stack = [];
    const lastIndexMap = {};
    for(let i=0; i<s.length; i++) {
        if(!lastIndexMap[s[i]]) {
            while(stack.length && s[i] < stack[stack.length-1] && lastIndexMap[stack[stack.length-1]] > i) {
                stack.pop();
            }
            stack.push(s[i]);
            lastIndexMap[s[i]] = i;
        }
    }
    return stack.join('');
};

